import AskQuestion from './AskQuestion';
import UserQuestion from './UserQuestion';
import OthersQuestion from './OthersQuestion';
import {
    BrowserRouter as Router,
} from "react-router-dom";

function RightPanel() {
    return (
            <div>
                <AskQuestion />
                <br />
                <UserQuestion />
                <br />
                <OthersQuestion />
            </div>
    );
}

export default RightPanel;
